import React, { useContext } from 'react';
import contactContext from '../../context/contact/contactContext';
export const Contacts = () => {
  const contact = useContext(contactContext);

  return (
    <div>
      {contact.Contacts.map((contact) => (
        <h1>{contact.name}</h1>
      ))}
    </div>
  );
};
